import React from 'react';
import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <table style = {{
        backgroundColor: '#000',
        display: 'block'
      }}>
        <tbody>
          <tr>
            <td>
              <img width = "100" src = "DSC01148.JPG"/>
            </td>
            <td>
              Favorite Movies
            </td>
          </tr>
        </tbody>
      </table>
    </div>
  );
}

export default App;
